import React, { Component } from "react";
import './soundpad.css';
import BoopButton from "./boopbutton";



class SoundPad extends Component {
    render() {
        return (

                <button className="sound-pad">
                    {this.props.value}
                    <BoopButton />
                </button>
        )

    }
}






export default SoundPad;
